                WriteLiteral(@"</div>
                        নেত্রকোণা সরকারি বালিকা উচ্চ বিদ্যালয়টি ১৯৩৭ সনে প্রতিষ্ঠিত হয়। প্রতিষ্ঠিা লগ্নে এ জনপদটি নারী শিক্ষায় অনেক পিছিয়ে ছিল। 
                        সময়ের ব্যবধানে নারী শিক্ষায় বিশেষ অবদান রাখায় ১৯৭০ সনে বিদ্যালয়টি সরকারিকরন করা হয়। 
                        এ জেলায় নারী শিক্ষার অগ্রগতির সাথে সাথে বিদ্যালয়ে শিক্ষার্থীর ভর্তির চাপও বাড়তে থাকে। 
                        অত্র জেলার নারী শিক্ষার অগ্রগতির জন্য ২০১০ সনে বিদ্যালয়টি ডবল শিফ্টে উন্নীত করা হয়। 
                        বর্তমানে বিদ্যালয়টিতে প্রায় ১৬০০ শিক্ষার্থী রয়েছে। বিদ্যালয়ে ৪র্থ-১০ম শ্রেণী পর্যন্ত চালু রয়েছে। 
                        একাডেমিক ফলাফল আশানুরুপ। ২০১৭ সনে বিদ্যালয়টি জেলার শ্রেষ্ঠ শিক্ষা প্রতিষ্ঠান হিসাবে স্বীকৃতি পেয়েছে। 
                        লেখাপড়ার পাশাপাশি শিক্ষার্থীরা সহপাঠক্রমিক কার্যক্রমেও এ জেলায় শ্রেষ্ঠত্ব ধরে রেখেছে। 
                        শিক্ষার্থীদের প্রতিভা বিকাশের মাধ্যম হিসাবে বিদ্যালয় থেকে “আলোকচ্ছটা” নামক স্কুল বার্ষিকী প্রকাশ করতে যাচ্ছে। 
